// src/pages/FaqPage.jsx
import React from "react";
import TopBar from "../components/TopBar";

const faqs = [
  {
    question: "How do I check out an item?",
    answer:
      "Go to the Log Items section, scan the barcode, and fill out the checkout form with the room, client name, and event number if available."
  },
  {
    question: "How do I check in an item?",
    answer:
      "Simply scan the item’s barcode. If it's currently checked out, the system will automatically check it back in."
  },
  {
    question: "What if the item is not scanning or not found?",
    answer:
      "If the item is not found, you will see an error message. Confirm the barcode is correct or contact a supervisor to have it added to the system."
  },
  {
    question: "What does 'Item is already checked out' mean?",
    answer:
      "It means someone else has already checked out the item. You must check it in before checking it out again."
  },
  {
    question: "Can I view my past check-ins and check-outs?",
    answer:
      "Yes. Navigate to the 'My History' page to view your full log history, including filtering by date, item, or action."
  },
  {
    question: "How do I reset my password?",
    answer:
      "Go to the My Profile page and use the 'Change Password' form. You'll need your current password to proceed."
  },
  {
    question: "Who do I contact for lost items?",
    answer:
      "Please report lost or misplaced items to your supervisor immediately so they can mark it in the system."
  }
];

function FaqPage() {
  return (
    <>
      <TopBar />
      <div className="p-6 bg-gray-900 min-h-screen text-white">
        <h2 className="text-3xl font-bold text-asuGold text-center mb-8">Frequently Asked Questions</h2>
        <div className="space-y-6 max-w-3xl mx-auto">
          {faqs.map((faq, index) => (
            <div key={index} className="bg-gray-800 p-4 rounded-xl shadow">
              <h3 className="text-lg font-semibold text-asuGold">❓ {faq.question}</h3>
              <p className="text-gray-300 mt-2 text-sm">{faq.answer}</p>
            </div>
          ))}
        </div>
      </div>
    </>
  );
}

export default FaqPage;
